const cacheName = "v1"; const cacheAssets = ['assets/CPquery.js','assets/Library.js','assets/logo.png','assets/Options.js','index.html','AboutLibrary/index.html','CPQuerySource/index.html','LibrarySource/index.html','PageOptions/index.html','PreviewLibrary/index.html','/','AboutLibrary/','CPQuerySource/','LibrarySource/','PageOptions/','PreviewLibrary/','LICENSE'];self.addEventListener('install', e => {e.waitUntil(caches.open(cacheName).then(cache => {cache.addAll(cacheAssets);}).then(() => self.skipWaiting()));});self.addEventListener('activate', e => {e.waitUntil(caches.keys().then(cacheName => {return Promise.all(cacheName.map(cache => {if (cache != cacheName) return caches.delete(cache);}))}));});self.addEventListener('fetch', e => {e.respondWith(fetch(e.request).catch(() => caches.match(e.request)));});